import React from "react";

const login = () => (
  <nav className="login">
    <h2>Inventory login</h2>
    <p>Sign in to manage your store's inventory.</p>
    <button
      className="github"
      onClick={() => this.props.authenticate("Github")}
    >
      Login with Github
    </button>
  </nav>
);

export default Login;
